int check_passwd(char* str) {
	if (strlen(str) != HSIZE) return -1;
	char encoded[HSIZE];
	encode(encoded, str);
	for (int i = 0; i < HSIZE; i++) {
		if (encoded[i] != hash[i % HSIZE]) return -1;
	}
	return 0;
}

